import React  from "react";
import { useParams } from "react-router-dom";
import Unit from "../components/Unit";


const UnitPage = (props) => {
const {shops} = props
const id = useParams().id

    if(!shops) return null;

    return(
        <div className="row">
            {props.value}
            <Unit {...shops[id]} />
        </div>
    )
}

export default UnitPage;
